import { Box, Dialog,TextField } from '@mui/material'
import React from 'react'


const LoginDialog = (props) => {
  const handleClose =() =>{
    props.setOpen(false)
  }
  return (
   <>
    <Dialog open={props.openDialog} onClose={handleClose}>
      <Box>
        <Box></Box>
        <Box><TextField /></Box>
      </Box>
    </Dialog>
   </>
  )
}

export default LoginDialog
